import { Card, CardBody, CardHeader, Modal,Button,ModalFooter,  Heading,  Input,FormControl, 
    ModalBody,ModalContent,FormLabel,ModalOverlay,ModalCloseButton,ModalHeader } from "@chakra-ui/react";
import {Form, useForm} from "react-final-form"
import React from "react";

export default function Insert(){

    const { isOpen, onOpen, onClose } = useDisclosure();

    const initialRef = React.useRef();
    const finalRef = React.useRef();

    return(
        <Card align={'center'}>
            <CardHeader>
                <Heading size={'md'}>Create New Category</Heading>
            </CardHeader>
            <CardBody>
            {/* <Center py={6}>
                <Stack borderWidth="1px" borderRadius="lg" w={{ sm: '100%', md: '740px' }}
                       height={{ sm: '476px', md: '25rem' }} direction={{ base: 'column', md: 'row' }}
                       bg={useColorModeValue('white', 'gray.900')} boxShadow={'2xl'} padding={4}>
                        
                </Stack>

            </Center> */}
             <Button onClick={onOpen}>Open Modal</Button>
             <Modal
        initialFocusRef={initialRef}
        finalFocusRef={finalRef}
        isOpen={isOpen}
        onClose={onClose}
      >
        <ModalOverlay />
        <ModalContent>
          <ModalHeader>Create your account</ModalHeader>
          <ModalCloseButton />
          <ModalBody pb={6}>
            <FormControl>
              <FormLabel>First name</FormLabel>
              <Input ref={initialRef} placeholder="First name" />
            </FormControl>

            <FormControl mt={4}>
              <FormLabel>Last name</FormLabel>
              <Input placeholder="Last name" />
            </FormControl>
          </ModalBody>

          <ModalFooter>
            <Button variantColor="blue" mr={3}>
              Save
            </Button>
            <Button onClick={onClose}>Cancel</Button>
          </ModalFooter>
        </ModalContent>
      </Modal>
            </CardBody>

        </Card>
    )
}
